  input: '"TEXT","F3XA","C00167320","Per the FECs request, please find an amendment
    for the 10/17/02-11/25/02 report.Changes include corrected coding of excess contributions;
    memo entries for the ASDC, Victory Fund, and American Women Vote! 2002 receipts;
    and disbursement coding.Additionally, please note that expenditures for media
    buy, radio, tv production, were related to 441 AD expenditures and appear on Schedule
    F.  Expenditures coded advertisement were generic in nature and did not support
    a federal candidate.Expenditures for the Ansonia, Branford, Hamden, and West Haven
    DTCs have been moved to Schedule B.Lastly, all transfers are correctly coded.In
    addition to the changes the FEC requested, please note that our internal audit
    process found several non-federal receipts coded for as federal receipts even
    though the receipts were deposited in the non-federal account.The data entry error
    has been corrected, and those non-federal receipts no longer appear on the attached
    amendment.Thank you."'
